import React from 'react'
import Card from 'react-bootstrap/Card';
import { useNavigate } from 'react-router-dom';
import Button from 'react-bootstrap/Button';
const Page3 = () => {
  const navigate = useNavigate(); 
  const handleLostClick = () => {
    navigate('/lost');  // Redirect to /lost for the Lost section
  };

  const handleFoundClick = () => {
    navigate('/found');  // Redirect to /found for the Found section
  };


  return (
  
    <>
      <div className="main">
        <div className="bg"></div>
        <div className="bg2"></div>
        <div className="bg3">
         
        </div>
        <div className="bg4">
        <Card style={{ width: '20rem', height:'20rem', marginLeft:80, marginTop:50}}>
      <Card.Body>
      <Card.Title style ={{fontSize:30, textAlign:'center', marginTop:50}}>Lost section</Card.Title>
        <Button 
  variant="secondary" 
  style={{ marginTop: 40, display: 'block', marginLeft: 'auto', marginRight: 'auto' }} 
  size="lg"  
  active  
  id='p3_b1'
  onClick={handleLostClick}
>
  click here
</Button>

        
      </Card.Body>
    </Card>
    <Card style={{ width: '20rem', height:'20rem', marginLeft:120, marginTop:50 }}>
      <Card.Body>
        <Card.Title style ={{fontSize:30, textAlign:'center', marginTop:50}}>Found section</Card.Title>
        <Button 
  variant="secondary" 
  style={{ marginTop: 40, display: 'block', marginLeft: 'auto', marginRight: 'auto' }} 
  size="lg"  
  active
  id='p3_b2'  
  onClick={handleFoundClick}
>
  click here
</Button>

        
      </Card.Body>
    </Card>
        </div>
      </div>
    </>
  );
};

export default Page3
